        .medalDD-count-medalDDtxt {
            margin-top: 1%;
            font-weight: 800;
            font-size: 24px;
            text-shadow: -2px -2px 0 #591b11, 2px -2px 0 #591b11, -2px 2px 0 #591b11,
                1px 1px 0 #591b11;
            /*  */
        }

        .light {
            position: absolute;
            height: 10px;
            width: 10px;
            border-radius: 50%;
            top: 5px;
            left: 115px;
            transform-origin: 5px 115px;
        }

        .light-twinkling {
            animation: 1s twinkling 3, 100ms 3s twinkling 3;
        }

        .light:nth-child(2n) {}

        .light:nth-child(2n + 1) {}

        .light:nth-child(2) {
            transform: rotate(36deg);
        }

        .light:nth-child(3) {
            transform: rotate(72deg);
        }

        .light:nth-child(4) {
            transform: rotate(108deg);
        }

        .light:nth-child(5) {
            transform: rotate(144deg);
        }

        .light:nth-child(6) {
            transform: rotate(180deg);
        }

        .light:nth-child(7) {
            transform: rotate(216deg);
        }

        .light:nth-child(8) {
            transform: rotate(252deg);
        }

        .light:nth-child(9) {
            transform: rotate(288deg);
        }

        .light:nth-child(10) {
            transform: rotate(324deg);
        }

        .medalDD-panel {
            margin: 24px auto 0;
            position: relative;
            height: 200px;
            width: 200px;
            border-radius: 100px;
            overflow: hidden;
        }

        .medalDD-sector {
            position: absolute;
            left: 100px;
            top: 0px;
            width: 100px;
            height: 200px;
            font-size: 14px;
            border-radius: 0px 100px 100px 0;
            overflow: hidden;
            transform-origin: left center;
        }

        .medalDD-sector:nth-child(1) {
            transform: rotate(-45deg);
        }

        .medalDD-sector:nth-child(2) {
            transform: rotate(0deg);
        }

        .medalDD-sector:nth-child(3) {
            transform: rotate(45deg);
        }

        .medalDD-sector:nth-child(4) {
            transform: rotate(90deg);
        }

        .medalDD-sector:nth-child(5) {
            transform: rotate(135deg);
        }

        .medalDD-sector:nth-child(7) {
            transform: rotate(180deg);
        }

        .medalDD-sector:nth-child(8) {
            transform: rotate(225deg);
        }

        .medalDD-sector:nth-child(2n + 1).medalDD-sector-inner {}

        .medalDD-sector:nth-child(2n).medalDD-sector-inner {}

        .medalDD-sector-inner {
            text-align: center;
            display: block;
            width: 40px;
            padding: 5px 3px 0 57px;
            height: 195px;
            transform: translateX(-100px) rotate(30deg);
            transform-origin: right center;
            border-radius: 100px 0 0 100px;
        }

        .medalDD-sector-inner span {
            display: block;
            transform-origin: center;
            transform: rotate(-19deg);
            color: #d46854;
        }

        .medalDDpointer {
            display: flex;
            justify-content: center;
            align-items: center;
            position: absolute;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -59%);
            transform-origin: 50.5% 55.8%;

            z-index: 10;
            height: 100px;
            width: 100px;
            padding: 6px;
            color: #fff899;
            line-height: 15px;
            font-size: 12px;
            text-align: center;
            transition: transform 3s cubic-bezier(0.2, 0.93, 0.99, 1);
        }

        .medalDD-medalDDresult {
            display: none;
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
        }

        .medalDD-medalDDresult-box {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            width: 100vw;
            height: 100vh;
            color: #fff;
            font-size: 20px;
            background-color: rgba(0, 0, 0, 0.8);
        }

        .medalDD-medalDDresult img {
            /* margin-top: -75%; */
            width: 73%;
            max-width: 500px;
        }

        @keyframes twinkling {
            50% {
                background: transparent;
            }
        }

        .medalDD-player {
            display: flex;
            align-items: center;
            line-height: 32px;
            font-size: 16px;
            font-weight: 700;
            color: #244661;
            text-shadow: -1px -1px 0 #fff, 2px -1px 0 #fff, -2px 2px 0 #fff, 2px 2px 0 #fff;

        }

        .medalDD-player img {
            width: 75px;
            height: 75px;
        }

        .medalDD-bg {
            display: none;
            position: fixed;
            /* bottom: 0; */
            max-width: 500px;
            max-height: 150px;
            width: 100vw;
            height: 22vw;
            /* background-image: url(''); */
            background-size: 100% 100%;
            /* background-color: #014b70; */
        }

        .medalDD-medalDDsetting-box {
            position: absolute;
            top: 0;
            left: 0;
            z-index: 99;
            display: none;
            justify-content: center;
            align-items: center;
            width: 100vw;
            height: 100vh;
        }

        .medalDD-medalDDsetting-dialog {
            position: absolute;
            top: 0;
            left: 0;
            z-index: 100;

            width: 100vw;
            height: 100vh;
            background-color: rgba(0, 0, 0, 0.8);
        }

        .medalDD-medalDDsetting-List {
            padding: 0px 42px 0 20px;
            z-index: 101;
            width: 300px;

    var medalDDonRotation = false;
    var medalDDreward = ["5000", "10000", "3500", "15000", "35000", "1000", "5000", "1500"];
    var medalDDgetReward = (function () {
        medalDDcurrentDeg = 0;
        return function () {
            var medalDDrotateDeg = Math.random() * 360 + 1080;
            medalDDcurrentDeg += medalDDrotateDeg;
            var rewardText = medalDDreward[Math.floor((medalDDcurrentDeg % 360 - 22.5) / 45)];
            return { deg: medalDDcurrentDeg, text: rewardText };
        };
    })();

    function medalDDprogressFn(medalDDprogressBarPP, medalDDprogressPP, medalDDsettingIcon) {
        let medalDDisDragging = false;


        medalDDprogressBarPP.addEventListener('mousedown', (e) => {
            e.stopPropagation(); // 
            medalDDisDragging = true;
            medalDDupdateProgressBar(e, medalDDprogressBarPP, medalDDprogressPP);
        });

        medalDDprogressBarPP.addEventListener('mousemove', (e) => {
            e.stopPropagation(); // 

            if (medalDDisDragging) {
                medalDDupdateProgressBar(e, medalDDprogressBarPP, medalDDprogressPP);
            }
        });

        medalDDprogressBarPP.addEventListener('mouseup', () => {
            e.stopPropagation(); // 

            medalDDisDragging = false;
        });
        medalDDsettingIcon.addEventListener('click', (e) => {
            e.stopPropagation(); // 

            if (medalDDprogressPP == medalDDprogress1) {
                medalDDsettingIcon.src = medalDDsettingIcon.src == medalDDupdateimgSetting.medalDDupdateimg2 ? medalDDupdateimgSetting.medalDDupdateimg1 : medalDDupdateimgSetting.medalDDupdateimg2
            } else if (medalDDprogressPP == medalDDprogress2) {
                medalDDsettingIcon.src = medalDDsettingIcon.src == medalDDupdateimgSetting.medalDDupdateimg3 ? medalDDupdateimgSetting.medalDDupdateimg4 : medalDDupdateimgSetting.medalDDupdateimg3
            }


        });

    }
    function medalDDupdateProgressBar(e, medalDDprogressBarPP, medalDDprogressPP) {
        const progressBarRect = medalDDprogressBarPP.getBoundingClientRect();
        const width = e.clientX - progressBarRect.left;
        const progressBarWidth = progressBarRect.width;

        const percentage = (width / progressBarWidth) * 100;

        //  left 
        const newStyle = document.createElement('style');
        newStyle.textContent = `
             .medalDD-progress::after {
              left: ${percentage - 1}%; 
         }
        `;
        // 
        document.head.appendChild(newStyle);
        medalDDprogressPP.style.width = percentage + '%';
        if (medalDDprogressPP == medalDDprogress1 && percentage > 0) {
            medalDDsettingIcon1.src = medalDDupdateimgSetting.medalDDupdateimg1
        } else if (medalDDprogressPP == medalDDprogress2 && percentage > 0) {
            medalDDsettingIcon2.src = medalDDupdateimgSetting.medalDDupdateimg3
        }
    }
    function medalDDresults() {
        medalDDresult.style.display = "none";
    }
    function medalDDbacks() {
        if (medalDDpageType == "list") {
            medalDDsettingBtn.style.display = "none";
            medalDDback.style.display = "none";
            medalDDhome.style.display = "flex";
            medalDDlistpage.style.display = "none";
            medalDDPlayer.style.display='flex'
        } else {
            medalDDwrapper.style.display = "none";
            medalDDlistpage.style.display = "block";
            medalDDsayHello();
        }
    }
    function medalDDsettingFn(event, val) {

        if (val) {
            medalDDsetting.style.display = 'none'
        } else {
            medalDDsetting.style.display = 'flex'
        }

    }
    function medalDDgoPage() {
        medalDDpageType = "page";
        //   medalDDback.style.display = "none";
        medalDDlistpage.style.display = "none";
        medalDDwrapper.style.display = "block";
    }
    function medalDDplays() {
        if (medalDDonRotation) return;
        medalDDonRotation = true;
        medalDDvalue = medalDDvalue - 60;
        medalDDcountValue.innerHTML = medalDDvalue;
        var nextStatus = medalDDgetReward();
        medalDDtxt.innerHTML = nextStatus.text;
        medalDDvalue += parseInt(nextStatus.text);
        medalDDresult.style.display = "none";
        medalDDpointer.style.transform = ` translate(-50%, -59%) rotateZ(${nextStatus.deg}deg)`;
    }
</script>
